import{_ as e,o as a,c as i,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 38.2-3460 Sufficiency of federal requirements; additional standards and qualifications for navigators.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-3460.md","filePath":"vacode/38.2-3460.md"}'),t={name:"vacode/38.2-3460.md"},n=r('<h1 id="§-38-2-3460-sufficiency-of-federal-requirements-additional-standards-and-qualifications-for-navigators" tabindex="-1">§ 38.2-3460 Sufficiency of federal requirements; additional standards and qualifications for navigators. <a class="header-anchor" href="#§-38-2-3460-sufficiency-of-federal-requirements-additional-standards-and-qualifications-for-navigators" aria-label="Permalink to &quot;§ 38.2-3460 Sufficiency of federal requirements; additional standards and qualifications for navigators.&quot;">​</a></h1><p>The Commission may determine whether the standards and qualifications for navigators provided by 42 U.S.C. § 18031 and any regulations enacted thereunder are sufficient to ensure that navigators can perform the required duties. If the Commission determines that the standards and qualifications are insufficient, the Commission shall adopt regulations establishing additional standards and qualifications to ensure that navigators can perform their required duties.</p><p>2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0752" target="_blank" rel="noreferrer">752</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0769" target="_blank" rel="noreferrer">769</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0916" target="_blank" rel="noreferrer">916</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0917" target="_blank" rel="noreferrer">917</a>.</p>',3),o=[n];function s(d,f,l,c,u,h){return a(),i("div",null,o)}const p=e(t,[["render",s]]);export{g as __pageData,p as default};
